import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

console.log('Index.tsx loaded!'); // DODAJ TO

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);

console.log('Root created!'); // DODAJ TO

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

console.log('App rendered!'); // DODAJ TO
